 relative; z-index: 1; }.hero-content a.btn { margin-top: 0.5rem; }.star { color: rgb(232, 199, 27); font-size: 21px; }.subscribe-button, input[type="email"] { display: block; font-size: 16px; padding: 10px; width: 100%; }.react-spinner-loader-swing div { border-radius: 50%; float: left; height: 1em; width: 1em; }.react-spinner-loader-swing div:first-of-type { background: linear-gradient(90deg, rgb(56, 92, 120) 0px, rgb(50, 87, 116)); }.react-spinner-loader-swing div:nth-of-type(2) { background: linear-gradient(90deg, rgb(50, 87, 116) 0px, rgb(71, 83, 106)); }.react-spinner-loader-swing div:nth-of-type(3) { background: linear-gradient(90deg, rgb(74, 83, 105) 0px, rgb(107, 77, 89)); }.react-spinner-loader-swing div:nth-of-type(4) { background: linear-gradient(90deg, rgb(116, 76, 85) 0px, rgb(149, 70, 70)); }.react-spinner-loader-swing div:nth-of-type(5) { background: linear-gradient(90deg, rgb(156, 69, 67) 0px, rgb(187, 64, 52)); }.react-spinner-loader-swing div:nth-of-type(6) { background: linear-gradient(90deg, rgb(195, 63, 49) 0px, rgb(216, 59, 39)); }.react-spinner-loader-swing div:nth-of-type(7) { background: linear-gradient(90deg, rgb(218, 59, 38) 0px, rgb(219, 65, 44)); }.react-spinner-loader-shadow { clear: left; padding-top: 1.5em; }.react-spinner-loader-shadow div { background: rgb(227, 219, 210); border-radius: 50%; filter: blur(1px); float: left; height: 0.25em; width: 1em; }.react-spinner-loader-shadow .react-spinner-loader-shadow-l { background: rgb(213, 216, 214); }.react-spinner-loader-shadow .react-spinner-loader-shadow-r { background: rgb(238, 211, 202); }@keyframes ball-l { 
